import styles from './Footer.module.css';

function Footer() {
  return (
    <div className={styles.footer}>
        <div className={styles.newsletter}>
        <p className={styles.subscribe}>Subscribe to our Newsletter</p>
        <div>
        <input className={styles.txt} type='text' placeholder='Your E-mail Adress'></input>
        <button className={styles.subm} type='submit'><img className={styles.arrow} src="data:image/png;base64,"/></button>
        </div>
        </div>
    </div>
  );
}

export default Footer;
